import React from "react";


class Menu extends React.Component{

    render() {
        const {navMenu} = this.props;
        return (
            <>
                <ul>
                    <li>
                        <a href="">{navMenu}</a>
                    </li>
                </ul>
            </>
        )
    }
}

export default Menu;
